import './App.css';
import {BrowserRouter as Router, Switch,Route } from 'react-router-dom'
import Header from './Components/Header/Header';

import Login from './Components/login/Login';



function App() {
  return (
    <div>
    <Router>

    <Header></Header>

   <Switch>

   <Route path='/login'>
   <Login></Login>
   </Route>

   </Switch>


    </Router>

    </div>
  );
}

export default App;
